import React, { useEffect, useState } from 'react';
import './navBarStyle.css';
import { useNavigate } from 'react-router-dom';

function NavBar() {
  const navigate = useNavigate();
  const [user, setUser] = useState({});

  useEffect(() => {
    const userData = JSON.parse(localStorage.getItem('user'));
    if (userData) {
      setUser(userData);
    } else {
      // Se os dados do usu치rio n칚o estiverem presentes no localStorage, redirecione para a p치gina de login
      navigate('/login');
    }
  }, [navigate]);

  return (
    <nav className="navigation-body">
      <button className="chamados">MEUS CHAMADOS</button>
      <h3 className="user">
        Seja bem-vindo, {user && user.name && user.name.split(' ')[0]}
        <span role="img" aria-label="Emoji Feliz">
          游뗵
        </span>
      </h3>
    </nav>
  );
}

export default NavBar;
